var base64 = require('base-64')
const utf8 = require('utf8')

exports.handler = async function (event) {
  try {
    let textArray = []
    let line = ''
    const offset = 28
    let text = 'Home of fearless web developer Silvestar BistroviÄ‡'

    if(event.queryStringParameters && event.queryStringParameters.text) {
      text = event.queryStringParameters.text
    }

    let words = text.split(' ')

    for (let i = 0; i < words.length; i++) {
      if(line.length + words[i].length < offset) {
        line.length += words[i].length;
        line += ` ${words[i]}`
      } else {
        textArray.push(line)
        line.length = words[i].length
        line = words[i]
      }

      if (i === words.length - 1) {
        textArray.push(line)
      }
    }

    const yPosition = 320
    const yOffset = 65
    let tspan = ''

    for (let i = 0; i < textArray.length; i++) {
      if(i < 4) {
        tspan += `<tspan x="160" y="${yPosition + (yOffset * i)}">${utf8.encode(textArray[i].trim())}</tspan>`
      }
    }

    const svg = `<svg width="1200" height="630" viewBox="0 0 1200 630" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"><rect width="1200" height="630" rx="20" fill="white"/><rect x="56" y="56" width="1088" height="518" rx="15" stroke="#FF3366" stroke-width="14"/><rect x="151" y="111" width="428" height="133" fill="url(#pattern0)"/><defs><pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1"><use xlink:href="#image0_1435_268" transform="matrix(0.00135685 0 0 0.00436641 0 -0.0021373)"/></pattern><image id="image0_1435_268" width="737" height="230" xlink:href="data:image/png;base64,"/></defs><style>text{font-family:sans-serif;font-size:55px;font-weight:500;fill:#000;stroke:#000;overflow:hidden}</style><text id="text2" x="160" y="279">${tspan}</text></svg>`


    return {
      statusCode: 200,
      body: base64.encode(svg),
      headers: {
        "content-type": "image/svg+xml"
      },
      isBase64Encoded: true,
    }
  } catch (error) {
    console.log(error)

    return {
      statusCode: 200,
      body: 'Error!',
      headers: {
        "content-type": "text"
      }
    }
  }
}
